import React from "react"
import Header from './Header'
import Sidemenu from './Sidemenu'
import Main from './Main'
import {Listcrypto} from "./component/crypto/Listcrypto"
import Footer from './Footer'


function App() {

  return (
    <section>
        <Header/>
        <Sidemenu/>
        <Main>
            <Listcrypto/>
        </Main>
        <Footer/>
    </section>
  );
}

export default App;
